@RestController
@RequestMapping("/api")
public class UploadController{

    private final DataseriesRepository dataseriesRepository;
    private static Logger logger = Logger.getLogger("Upload logger");

    @Autowired
    public UploadController(DataseriesRepository dataseriesRepository){
        this.dataseriesRepository = dataseriesRepository;
    }

    @PostMapping("/upload")
    @ResponseStatus(HttpStatus.BAD_REQUEST)
    public void uploadNewSeries(@RequestBody Dataseries data){
        logger.finer("New data received");
        if(data.getData()==null){
            throw new InvalidDataException("Missing Data");
        }
        if(data.getUserId()==null){
            throw new InvalidDataException("Missing UserId");
        }
        this.dataseriesRepository.save(data);
        logger.finer("New data uploaded");
    }

    @GetMapping("/upload")
    public Iterable<Dataseries> testUpload(){
        return this.dataseriesRepository.findAll();
    }
}

